import React from "react";

function Header() {
  return (
    <section class="header">
        <div class="header-container">
            <div class="complete-navbar" id="complete-navbar">
                <li class="navbar">
                    <a id="header-content">Makonis</a>
                    <a id="home" href="./">Home</a>
                </li>
            </div>
        </div>
    </section> 
  );
}

export default Header;
